import React from 'react';
import PropTypes from 'prop-types'

const DataGrid = (props: any) => {
    return (
        <>
            <ul>
                <li>
                    {props.data.name}
                </li>
                <li>
                    {props.data.level}
                </li>
                <li>
                    {props.data.vocation}
                </li>
                <li>
                    {props.data.sex}
                </li>
                <li>
                    {props.data.residence}
                </li>
                <li>
                    {props.data.world}
                </li>
            </ul>
        </>
    )
}

export default DataGrid;
